import React from "react";
import { TextField } from "@mui/material";'@mui/material/TextField'

function InputComponent({ inputType, label, onChange }) {
  return (
		<TextField
			required
			id={label}
			label={label}
			type={inputType}
			variant="filled"
			onChange={onChange}
		/>
  );
}

export default InputComponent;
